 culture_aborigine_desc:0 "Аборигены Великих южных островов говорят о 300 разных языках, но все они разделяют народные ДреамТиме легенды."
 culture_afar_desc:0 "Афар общество с центром в раёне Африканского Рога, где Адал Султанат процветал во время раннего Нового времени."
 culture_africaine_desc:0 "После колонизации, французский народ на африканском континенте создали новый жаргон Их собственный, отличный от митрополита французского."
 culture_african_minor_desc:0 "Много разных племен Африки никогда не удалось на самом деле попасть в уместности, но это вовсе не означает, что они не могли бы достичь политического значения."
 culture_africano_desc:0 "Напоминает римскую провинцию Африка, итальянские народное Это пошло на юг создал язык и традицию своего, но по-прежнему связан с Европой в их проишождении."
 culture_afro_american_desc:0 "Работорговля броугхт` многие африканские племена на новый континент Запада, но некоторым удалось получить независимость Самостоятельно, после того, как «возвращение домой \»."
 culture_afro_antillean_desc:0 "Сыновья темной кожи карибских рабов, которые восстали против белых повелителей, они традиция и культур фактического значения настройки."
 culture_afro_brazilian_desc:0 "«Прет» люди южных штатов, которые отказались ярмом европейских властителей, Достигнутый политическая позицию в мире."
 culture_afro_caribbean_desc:0 "Ишодя из вынужденных переселенцев из Африки, которые должны были выращивать плантации этого острова, афро-карибские являются реальными людьми из их собственных."
 culture_afro_caribeno_desc:0 "Связанное с народом Африки Морадо, эти люди спускаются с испаноязычных завоевателей и африканских рабов, которые обитали на Карибские острова."
 culture_aimara_desc:0 "Коренные жители боливийской области, аймар (или Аимара) являются одной из цивилизаций, которые существовали до колонизации Нового Света."
 culture_ainu_desc:0 "Жители северного острова японского архипелага, айны (исторически также Езо) имеют сложный язык и многие традиции."
 culture_akan_desc:0 "Акан представляет собой группу из многих этнических групп, в первую очередь сосредоточен вокруг Голд Цоаст региона Западной Африки."
 culture_alan_desc:0 "Аланы являются чернью шодя с кочевого и пасторов, которые были в основном сосредоточены вокруг Осетинской области."
 culture_albanian_desc:0 "Албанцы или Шяиптарс являются этнической группой на Балканах, известный бунте Гэргй Скандербега против османских владык."
 culture_alien_desc:0 "Есть много и различных инопланетных рас во всей Вселенной. Несмотря на то, что они не должны существовать до 2200, кажется Стелларис просочилась в эту игру, не так ли?"
 culture_all_italian_desc:0 "Региональные государства Италии разработали правильную идентичность, но итальянцы за пределами тех, никогда не отличались друг от друга, и, таким образом, создали новые итальянские культуры."
 culture_amazonian_desc:0 "Коренные жители бразильской глубинки, в основном жилище на пути их предков, по-прежнему обитают в тропических лесах Амазонии."
 culture_americano_desc:0 "В испаноязычных людях племен Северной Мешица создали свою собственную идентичность на новых идеалах, отличных от европейской родины."
 culture_amerikaner_desc:0 "Пруссаки, баварцы, или австрийцы, к немецкому народному Нев Ворлд разделяет общее проишождение и традицию, не забывая при этом своей идентичности."
 culture_amhara_desc:0 "Также известно как абиссинцы, этническая группа властвует Королевства Аксума и Империю Эфиопии в раёне Африканского Рога."
 culture_andalucian_desc:0 "Люди Сарацинских слились с туземцами романских и вестготов, создавая традиции своего и романский язык написанного с арабской вязью."
 culture_anglo_african_desc:0 "Британская империя перешла на завоевание африканского континента. Его сыновья в настоящее время живут с немного другим языком Родины."
 culture_anglo_canadian_desc:0 "В основном из британских островов, цолонизаторс пришел жить в земле «Канат \», а постепенно получать независимость от европейской родины."
 culture_anglo_saxon_desc:0 "Углы, саксы и юты, завоевавшие остров Британия дали ему новое имя и личность, в то время как о возбуждении нового общества."
 culture_araucanian_desc:0 "Также известные как мапуче, это коренное население населяло Патагонию земель пути до контакта со Старым Светом."
 culture_armenian_desc:0 "Сам называется «Хаэр \», этот Кавказский народ был первым принять Чристианисм в своих убеждениях, и которые в основном управляла областью Южного Кавказа."
 culture_ashkenazi_desc:0 "Немцы и хазары, принявшие иудаизм в первом тысячелетии они были в основном рассредоточены до получения политической независимости."
 culture_asian_minor_desc:0 "Многие этносы Азии не могли получить все перечисленные, но некоторые из них безымянных удались получить политическое значение."
 culture_assamese_desc:0 "А физически разные люди, они живут в основном в области Ассама. Былой называется «Камаруп \», у них есть собственные костюмы и традиция."
 culture_assyrian_desc:0 "Ассирийцы, или Сирийцы, спускаются с доарабским населения области Машрике и правили огромные империи в Доклассическом древности."
 culture_australian_desc:0 "Потомки британских переселенцев, отправившихся в Великие южные земли, им удалось создать культуру почти полностью чуждую европейские родитель."
 culture_australiano_desc:0 "Итальянцы, которые пошли в «Терра Аустралис \» не полностью следуют с европейской родиной, создавая собственные традиции."
 culture_australienne_desc:0 "Несмотря на то, спускаясь с французами и Оццитанс, народ южных земель все еще имеют свои традиции и костюмы."
 culture_avadhi_desc:0 "Индоарийский чернь Это Обитает один из основных раёнов Северной Индии, мощный Авадхис правил герцогства и королевства."
 culture_azande_desc:0 "Азанде (Занде или) люди обитают в бассейне Конго в самом сердце Африки."
 culture_azerbaijani_desc:0 "Тюркские народы Кавказа, под влиянием использования персов, создали свою собственную национальную идентичность и придерживаться личных традиций."
 culture_baganda_desc:0 "Банту Эта группа спускается от средневекового состояния Буганды, они обитают в юго-восточной части Африки, в основном."
 culture_baguirmi_desc:0 "Сосредоточенный на озере Чад в Западной Африке, люди Багуирми удалось получить империю Самостоятельно в начале Нового века."
 culture_bai_desc:0 "Одна из многих групп Китая, люди Бай основном жили в Юньнань регионе. Их название буквально означает «белых людей \»."
 culture_bakongo_desc:0 "Банту этническая принадлежность, люди Конго в основном живут в одноименным бассейне Конго и были сосредоточены в омониме Конго государства."
 culture_baluchi_desc:0 "На границе между персами и индийцами, люди Белуджистана совместно обитать с пуштунов, в то время как имеющие свои традиции."
 culture_bambara_desc:0 "Люди Бамбара являются этнической принадлежностью региона Западной Африки, с центром в раёне Мали."
 culture_basque_desc:0 "Баскский народ никогда не отказывался от их личность, несмотря на их, безусловно, более мощных соседей."
 culture_bedouin_desc:0 "Арабские жители Аравийского полуострова ядра, которые до сих пор в основном живут в кочевых путях и есть только несколько городов."
 culture_beifaren_desc:0 "Хотя есть много этнических групп в Китае, большинство людей на Севере придерживаются очень похожим образом. Китайцы делиться своей сложную системой письма."
 culture_beja_desc:0 "Традиционные Кушитские кочевники, люди беджа в основном жили в раёнах к югу от Египта, и было мало, чтобы не политического значения вплоть до современной эпохи."
 culture_bengali_desc:0 "Индо-арийская группа, бенгальцы обитают в восточной части Индийского субконтинента и имела мощные региональные Емпирес."
 culture_berber_desc:0 "Также известен как амазигов, кочевые берберы являются популацес, которые живут в странах Магриба, отличные от арабских и романо поблизости."
 culture_bihari_desc:0 "В бихари являются индийская группа. Она может быть разделена на бходжпури, в Маитхилс, и Магахис, но тем не менее имеют шожие костюмы."
 culture_boer_desc:0 "Спускаясь от голландских фермеров, которые поселились в Африке, буры вскоре наладки состояний своего и новом языке: африкаанс."
 culture_bornean_desc:0 "Восточная половина малазийского народа, Борнео люди в основном Выявленные с мощным Султаната Бруней."
 culture_bosniak_desc:0 "Сыновья сербов и хорватов, которые перешли в ислам, Боснийские являются одним из Югославиц национальной идентичности, и по-прежнему бороться за свою собственную идентичность."
 culture_brazilian_desc:0 "Из испаноязычной, которые поселились в южной части Нового Света, бразильцы сумели нарушить европейское иго."
 culture_breton_desc:0 "Один из немногих кельтских народов в современном мире, бретонцы Их традиционно боролись за независимость от франкских герцогов."
 culture_british_desc:0 "Кодифицированное с 15-го века, личность Инглесе удалось процветать и распространяться по всему миру, сохраняя при этом соседнее соперничество с шотландцами."
 culture_bulgarian_desc:0 "От славян Византии и кочевых племен Поволжье, болгары получили свою собственную идентичность и в основном сосредоточены в раёне Балкан."
 culture_burmese_desc:0 "Сам называется «Бамар \», бирманские люди в основном живут в регионе и правили индокитайские мощные региональные государства."
 culture_byelorussian_desc:0 "Обитатели «Белый Рутения \», белорусы Получили свою идентичность отдельно от соседних русских и украинцев."
 culture_caddoan_desc:0 "Несколько коренных племена Нового Света идентифицироваться с общей родословной, сосредоточенной на Каддо, которые были сформированы."
 culture_caribeno_desc:0 "В испаноязычных людей, которые обосновались в Карибском острове медленно поднялся отличается от родины в Европе и получил свою собственную идентичность."
 culture_carribean_desc:0 "Уроженцы в антильской архипелаге Эти народными были первыми приветствовать Старый Свет, но никогда не отказывались от их независимости."
 culture_cat_desc:0 "Отечественный Цат-- ждать, что, черт возьми? Это состояние управляется кошек, как это должно быть нормально?"
 culture_catalan_desc:0 "Романская культура, разработанная на Пиренейском полуострове, что в основном боролась против испанцев и правившего Арагон и Каталонию."
 culture_central_algonquian_desc:0 "Один из самых густонаселенных Нативе группы Нев Ворлд, алгонкинов есть много различных племен. Это оны Оутбацк."
 culture_central_american_desc:0 "Из Панаман перешейка полуострова Юкатан, испаноязычные люди получили новую идентичность, борются против их соседей."
 culture_chacoan_desc:0 "В основном сосредоточено в области Ацтлана, Чако был одним из многих коренных групп Нового Света."
 culture_cherokee_desc:0 "Чероки, которые сами, как стиль Тсалаги, многие населенные пункты Нового Света, до того, чтобы защищать их собственный европейскую идентичность от смерти угрозы."
 culture_chewa_desc:0 "Чева, одна из многих групп банту, в основном сосредоточен в раёне озера Малави."
 culture_chibchan_desc:0 "Также известен как музыка, Чибчанс управлял областью вблизи Панаман перешейка до контакта со Старым Светом."
 culture_crni_desc:0 "С сербской империи и Королевством Хорватии, африканский континент устроился с людьми, с новым и собственной идентичностью и костюмами."
 culture_croat_desc:0 "Поскольку паннонских инвазий, славянская католическое население Балкан Выявленные с региональным государством Хорватии."
 culture_czarny_desc:0 "Поляки, которые пошли на южноафриканском континенте, наряду с другими, создал идентичность своих собственных."
 culture_czech_desc:0 "Названные богемы до современной эпохи, чехи не исключают в этой области в основном сосредоточен на Праге."
 culture_dakshin_desc:0 "Хиндустанис, отправившийся в Великие южные земли создали свою собственную идентичность, отличную от региональных Индостаны."
 culture_danish_desc:0 "Главные актеры викингов, датчане являются этническим центром на полуострове, что стречес из Европы в Балтийском море."
 culture_delian_desc:0 "Также называется «Граждане Австралии-Венгрии \», то Делианс спускаются с колонизаторами Магяр Великого Южного континента."
 culture_dhen_desc:0 "Индокитай люди, которые пошли на африканский континент естабилишед региональных государств в этой области, объединяя их различие в новые традиции."
 culture_dinajidad_desc:0 "Персы и татары Нового Света, то Динайидадс остановит ничего, чтобы сохранить свою идентичность."
 culture_dinka_desc:0 "Одна из многих этнических групп африканского континента, динка в основном сосредоточена на юге Египта."
 culture_dixie_desc:0 "От англичан и ирландцев, население Флориды и соседних областей в основном называют себя «Дикси \» и сохранены многие из забытых традиций европейского Инглезе."
 culture_dongren_desc:0 "Корабли могущественной империи Мин пошли на оседаете континент над вошодящим солнцем, неся китайскими иероглифами с ними, создавая новые костюмы."
 culture_dummy_desc:0 "Результатом амнезия эпидемии, эти люди даже не знают, что они являются частью одного и того же этнического проишождения и даже не имеют реальные традиции."
 culture_dutch_desc:0 "Иногда Именуется нидерландцев, голландские люди разделяют общую культуру на земле, которая находится в основном ниже уровня моря."
 culture_dyula_desc:0 "Кроме того, как пишутся Юула, эти люди в основном обитают в западном африканское побережье."
 culture_ealimi_desc:0 "Мусульманские мигранты, которые пошли в новом мире броугхт` арабский с ними и хорошо известны своими зданиями двойных башен в их городах."
 culture_eastern_algonquian_desc:0 "Один из самых густонаселенных Нативе группы Нев Ворлд, алгонкинов есть много различных племен. Это те атлантического побережья."
 culture_edo_desc:0 "В основном сосредоточено в раёне Бенина, люди Эдо проишодят от средневекового государства Бенинской империи."
 culture_english_desc:0 "Кодифицированное с 15-го века, личность Инглесе удалось процветать и распространяться по всему миру, сохраняя при этом соседнее соперничество с шотландцами."
 culture_eskaleut_desc:0 "Сформированный инуитов и Юпикс, племена Ескалеут удалось адаптироваться к новой концепции страны, а не отказываясь от своих древних традиций."
 culture_esmer_desc:0 "Путь турецкого броугхт` был на африканском континенте и, создавая новые традиции, она по-прежнему идентифицирует себя с турецкой идентичностью."
 culture_estonian_desc:0 "Один из немногих угорских народов Европы, эстонцы населяют Восточную Прибалтику и гордятся своей национальной идентичностью."
 culture_ewe_desc:0 "Самая крупная этническая группа области, известная как Того, люди эва является одним из многих этнических африканских племен."
 culture_falklander_desc:0 "Сыновья и дочери британской колонизации области к югу от перешейка Панаман, фолклендцы никогда не дают в подчинение."
 culture_fang_desc:0 "Банту этническая принадлежность, люди Фанг в основном жили в раёне, известном как Габон и Камерун."
 culture_fekete_desc:0 "Орды Магяр не забыли об африканском континенте, сливаясь с местными жителями там и создать новую идентичность, Фекет."
 culture_filipino_desc:0 "Народ уроженца Архипелага, филиппинцы проистекают из множества различных этнических групп и языков."
 culture_finnish_desc:0 "В основном известны сауны изобретения, люди Финна в основном населяют Скандинавский полуостров и очень трудно победить."
 culture_flemish_desc:0 "Очень похожа на голландские их сосед, фламандские являются этнической группой области, известной как «Бельгия \»."
 culture_fon_desc:0 "Также называется Дахомеы, люди Фон в основном жили в раёне Бенина Африки, но Анче в соседних регионах."
 culture_frankish_desc:0 "Из коллекции германских племен, франкские люди поселились в Галлии, есть приведение их собственные традиции."
 culture_french_desc:0 "Спустившись с франками, французские люди из огромного куска Западной Европы."
 culture_french_canadian_desc:0 "Спустившись с французами, которые спускаются с франками, французские канадцы населяют эту область от двух до Нового Света колонизации."
 culture_fulbe_desc:0 "Тем не менее известно, как Фуле, фульбе людей африканской родной группы, в основном проживающих в регионе Сахеля."
 culture_fur_desc:0 "Фур этнического проишождение, один из многих местных африканских, в основном обитают в суданском регионе."
 culture_galician_desc:0 "Национальная и этническая группа Пиренейского полуострова, галичане не будет легко забыть свои собственные костюмы, языка Хотя переход к Кастилии, возможно, уже произошел."
 culture_georgian_desc:0 "Грузины или картвелы, эти люди обитают в Западном Южном Кавказе, между сильными соседями, но все-таки с собственной идентичностью."
 culture_german_desc:0 "Спустившись с тевтонов и пруссаков, немецкий народ унифицированы На протяжении мощной национальной идентичности."
 culture_greek_desc:0 "Сонс византийского элитного класса, греческие или Хеллениц люди до сих пор обитают в области, в то же время очень богатой историей."
 culture_guajiro_desc:0 "Люди Гуахиро~д являются одним из коренных групп Нового Света, в основном в раёне венесуэльского бассейна."
 culture_guarani_desc:0 "В основном живет в раёне между Патагонии и Бразилии, народ гуарани не забывать об их использований с контактом со Старым Светом."
 culture_gujarati_desc:0 "Одна из многих индийских групп, гуджаратской в ​​основном обитают в западной части Индийского субконтинента."
 culture_guney_desc:0 "Тхе Греат Соутхерн Ланд, как-то заселена турками, удалось получить новую идентичность, не забывая при этом, хотя их древних традиций."
 culture_hakka_desc:0 "Одна из многих этнических групп китайских земель, люди Хакка имеют свои собственные традиции и самобытность и живут в основном в раёне Шаньси."
 culture_harari_desc:0 "Одна из этнических групп в раёне Африканского Рога, люди Харари имели свою идентичность с 14-го века, и до сих пор."
 culture_hausa_desc:0 "Одна из самых больших групп в нигерийском регионе Африки, хауса был правителями мощных султанатов и королевств."
 culture_hawaiian_desc:0 "Аборигены Полинезии Архипелага, гавайцы были правители их собственного королевства одноименного."
 culture_hazara_desc:0 "Один из двух этнических групп афганского народа, Хазара имеет свои собственные традиции и костюмы."
 culture_heiren_desc:0 "Китайские чиновники, осевшие на африканском континенте, смешиваясь с туземцами, создали новую собственную идентичность, сохраняя при этом сложные символы."
 culture_herero_desc:0 "В основном проживающий в Намибии области, гереро является одним из коренных народов Африки."
 culture_hnedy_desc:0 "Спустившись с богемы, которые поселились на африканском континенте и туземцев, эти люди создали свою собственную идентичность."
 culture_horse_desc:0 "От троянского коня, наследие Еяуус Ферус Цабаллус не прекращалось, достигая новые вершины в международном значении."
 culture_hungarian_desc:0 "Венгры потомок Тенгри мадьяр, поселившийся Паннонский бассейна в 10-м века."
 culture_ibibio_desc:0 "В связи с другими африканскими группами, то Ибибио живут в основном в раёне нигерийской области."
 culture_ibo_desc:0 "Также пишется игбо, это один из многих африканских коренных групп, в основном сосредоточенных в Гвинейском заливе."
 culture_icelandic_desc:0 "С 10-го века, поселенцы Викинга этого маленького забытым острова создали свою собственную идентичность, что исландцы."
 culture_ifriqi_desc:0 "К югу от Сахары, арабский народ создал другой образ жизни с образом жизни бедуинов, не забывая при этом своих традициях."
 culture_irish_desc:0 "Один из немногих кельтских народов в современном мире, ирландцы живет на острове и воевал одноименный против Инглеза своих соседей."
 culture_iroquoian_desc:0 "Результат встречи с Старого Света, эти Нового Света туземцы быстро удалось понять новые идеи, не забывая при этом их исконных пути."
 culture_italoamericano_desc:0 "Спускаясь от итальянских людей, которые мигрировали из Европы, этот американский народ имеет костюмы обеих культур."
 culture_itsekari_desc:0 "Одна из многих этнических групп африканского континента, Итсекари (или Итсекири) в основном живет в Гвинейском заливе."
 culture_janalem_desc:0 "Потомки Чингишана, эти люди имеют свою собственную идентичность в Новом Свете, но все еще имеют много с их Старым Светом предками."
 culture_janub_desc:0 "Народ Великой Южной Земли, заселенный персы, которые создали свою собственную идентичность в этой новой территории."
 culture_janubii_desc:0 "Народ Великой Южной земли, заселенные турками, которые создали свою собственную идентичность в этой новой территории."
 culture_japanese_desc:0 "Нативе к Ниппониан архипелага, японцы имеют давние традиции ведения войны и феодализма."
 culture_javan_desc:0 "Южная половина малазийского народа, Джаван или индонезийского народа в основном Выявленный с региональным состоянием Ява."
 culture_je_desc:0 "Несмотря на то, состоит из множества различных групп, в Э бразильцы региона, чтобы разделить общее проишождение и шожие традиции."
 culture_jizni_desc:0 "Из богемы, который пошел на юг, Моравии, которые люди создали свою собственную национальную идентичность с реальными традициями."
 culture_juzhno_desc:0 "Южные славяне, пошли дальше на юг, люди Южно в основном живут в Греат Соутхерн Ланд."
 culture_kaala_desc:0 "Сыны Хиндустанис и африканцев, люди имеют Каала свою собственную идентичность и традиции."
 culture_kachin_desc:0 "Одна из многих этнических групп Индокитайской области, Качины не менее важны, чем другие."
 culture_kanauji_desc:0 "Очень похож на Авадхи, то Канауйи является одной из других этнических групп Индии, но главная ответственность за «Индиан \» язык."
 culture_kannada_desc:0 "Сосредоточенный в штате Карнатака, народ каннады является одним из многих этнических групп индийского субконтинента."
 culture_kanuri_desc:0 "Одна из этнических групп, сосредоточенных в Чад озере Африка, канури является этническим средневековой Канут империю."
 culture_karen_desc:0 "Одна из многих этнических групп Индокитайской области, Карен не менее важен, чем другие."
 culture_kashmiri_desc:0 "Высоко под влиянием китайских и тюркских их соседями, Кашмирцы один из многих этнических групп индийского региона."
 culture_kazak_desc:0 "А тюрки, которые в основном обитают в Средней Азии, казахи состоят из множества групп, объединенных общим языком и идентичностью."
 culture_kefficho_desc:0 "Другие из Африканского Рога этнических групп, то Кеффичо главным образом идентифицироваться с средневековым королевством Кафф."
 culture_khmer_desc:0 "Юго-восточной азиатской группы, кхмеры в основном известен своим монументальным Монастер в Ангкор-Ват."
 culture_khoisan_desc:0 "Коренные жители в южной части Африки, койсанских люди до сих пор живут уважение их традиций предков."
 culture_kikuyu_desc:0 "Сосредоточенный вокруг Восточной Африки, люди кикуйю является одним из многих коренных африканских этнических групп."
 culture_kirgiz_desc:0 "Существующие из 529, Киргизская этничность один из самых мощных в регионе Центральной Азии."
 culture_korean_desc:0 "Корейский народ один из восточно-азиатских национальностей, между более могущественными китайскими и японскими соседями."
 culture_kru_desc:0 "В основном сосредоточено вокруг побережья Западной Африки, люди кра является одним из многих коренных народностей континента."
 culture_kurdish_desc:0 "Курды основном население раёна Северного Машрика, стебли, из которого императоров, но мало реальных народов."
 culture_lao_desc:0 "Индокитайская группа, народ Лаоса в основном идентифицирует себя с Лансанг и историческими состояниями Луанга Пхрабанг."
 culture_latvian_desc:0 "Союз Куршских и земгалы, латышский народ является одним из балтийских этнических групп Европы."
 culture_lithuanian_desc:0 "Со времен Гедимина, литовцы были одним из наиболее важной Балтийской группы."
 culture_lombard_desc:0 "А германские люди, которые обосновались в основном на итальянском полуострове в 7-м века, он никогда не отбрасывали их родословной, как герцоги Лонгобардии."
 culture_lomwe_desc:0 "Одна из многих этнических групп банту вокруг озера Малави Ломве является этничность."
 culture_lounast_desc:0 "Тхе Греат Соутхерн Ланд увидел эстонцев и латышей в отстойнике, который создал Хотя собственной идентичности, отличной от европейской родины."
 culture_luba_desc:0 "Еще в бассейне реки Конго, люди Луба когда-то правили мощной региональной государственной омоним."
 culture_lumenoua_desc:0 "Даки, которые обосновались в Новом Свете не отказаться от своих Десценданце от римлян, но совершенно разные традиции."
 culture_lunda_desc:0 "Еще в бассейне реки Конго, народ Лунда когда-то правили мощной региональной государственной омоним."
 culture_luo_desc:0 "Сосредоточенный в восточной части Африки, люди Ло является одним из многих коренных групп на континенте."
 culture_maasai_desc:0 "Известное своей гигантской высоту, масай являются одним из самых известных африканских коренных групп."
 culture_macedonian_desc:0 "От слияния болгар с сербами, македонский народ в основном Обозначается Климента Охридского, изобретатель сценария кириллицы, а не греческой империи Александра."
 culture_maghreb_arabic_desc:0 "Романце население провинции Африки развивались собственные обычаи и литературу, став известной как мавров."
 culture_maghrebi_desc:0 "С исламской экспансии, Магриб регион стал домом для многих арабских государств на основе, которые до сих пор правят сегодня."
 culture_makua_desc:0 "В основном Мозамбияуеан из области, Макуо является одним из многих африканских коренных этнических групп."
 culture_malagasy_desc:0 "Жители Африки только немного к востоку от африканского континента, малагасийцы увидели мощные региональные государства."
 culture_malay_desc:0 "Западная половина малазийского народа, малайский народ в основном Выявленные с мощным Султаната Малакки."
 culture_malayalam_desc:0 "Также пишутся Малаяли, это один из многих этнических групп и многие индийских субконтинентов."
 culture_maltese_desc:0 "От слияния итальянцев и мусульман, жители Мальты создали свои собственные традиции, основываясь на устаревших госпитальеров."
 culture_manchu_desc:0 "Жители северо-восточной части Китая региона, маньчжуры в основном следуют Кочевые пути, но господствуют мощных государств региона."
 culture_mande_desc:0 "Семейство многих африканских этнических групп, то Манде живет в основном в регионе Западной Африки."
 culture_manipuri_desc:0 "Индоарийская этническая принадлежность, люди Бишнуприя Манипури является одним из многих этнических групп на субконтиненте."
 culture_maori_desc:0 "Оригинальные Обитатели острова Аотеароеа (также известный как Новая Зеландия), Маори по-прежнему подчиняться их исконные традиции."
 culture_maranon_desc:0 "Родные индигенс раён, известный как Мараньи, то Мараñóнс еще подчиняться их исконные традиции."
 culture_marathi_desc:0 "В основном известно маратхи империя, это один из многих этнических групп индийского субконтинента."
 culture_mashriqi_desc:0 "Одна из разновидностей арабского народа, Машрияи в основном разделены между собой «Иракцы \» и «сирийцев \»."
 culture_maures_desc:0 "Жители региона юга Марокко, Мор держаться независимости и древних традиций."
 culture_mavro_desc:0 "Торжество в Африке византийского наследия создало совершенно новый этнос, МАВРО людей."
 culture_mayan_desc:0 "Одна из самых передовых цивилизаций индейцев Центральной Америки, они предсказывают конец света к 2012 году Будет ли это быть правдой?"
 culture_melanesian_desc:0 "Родные и доминирующие Жители одного из трех основных регионов Океании. Это меланезийцев."
 culture_metis_desc:0 "Сыновья уроженцев Нового Света и цолонизаторс Старого Света, они получили традицию шпангоутов, но прочность латтерс."
 culture_mexican_desc:0 "Потомство испаноязычных людей в раёне, известном как Мешица, мексиканцы известны своей своеобразной кухни."
 culture_miao_desc:0 "Одна из многих этнических групп китайских земель, народ его живет в основном в раёне, известном как Юньнань."
 culture_micronesian_desc:0 "Родные и доминирующие Жители одного из трех основных регионов Океании. Это Микронезия."
 culture_min_desc:0 "Одна из многих этнических групп китайских земель, МИН люди в основном живут в раёне, известном как Гуандун."
 culture_misri_desc:0 "Сам называемый Мисри, арабские египтяне произошли от исламских поселенцев 8-го века."
 culture_moluccan_desc:0 "Группа из многих этнических групп между малазийцами и Новой Гвинеей, они держат на древних традиции."
 culture_mongo_desc:0 "Одна из многих банту этнических групп бассейна Конго, люди Монго имеют много древних костюмов."
 culture_mongol_desc:0 "Боялись Для их мощных средневековых орд, монгольский народ в настоящее время живет в основном в раёне пустыни Гоби, но они все еще боятся."
 culture_morado_desc:0 "С противоположной судьбой афро-Царибеñо, люди Морадо спускаются с латиноамериканцев и африканцев."
 culture_mossi_desc:0 "Одной из основных групп области Буркина-Фасо, то Мосси управлял многими царствами в современной эпохе."
 culture_muskogean_desc:0 "Также известный как Крик, то Мусцогее были одним из многих Старого Света родной популацес."
 culture_mustvalge_desc:0 "Эстонцы и латыши не отказываются селиться африканский континент, пытаясь сохранить свои традиции связаны между собой, хотя создание новых."
 culture_na_dene_desc:0 "В основном навахо и апачи, тем На дене формируются многими нативных групп Нев Ворлд."
 culture_nahua_desc:0 "Потомки ацтеков Тройственного союза, это была первая группа населяют область, известную как Мешица."
 culture_nanfaren_desc:0 "Хотя есть много этнических групп в Китае, большинство людей на юге придерживаются очень похожим образом. Китайцы делиться своей сложную системой письма."
 culture_nanren_desc:0 "Люди мандарина, поселившиеся Великая Южная Земля не может отказаться создать свою собственную региональную идентичность, хотя до сих пор похожи на старом мир один."
 culture_native_american_minor_desc:0 "Многие и многие из них были культуры, которые существовали в Новом Свете, но немногим удалось получить значительные, и еще меньше по-прежнему существуют."
 culture_nayeduniya_desc:0 "Индийские штаты не забудьте взять с карри в области Нового Света, где возникла новая культура, известная для известного Болливуда."
 culture_negru_desc:0 "Сыновья даков, которые пытались повторить провинции Африка, люди Негру до сих пор отказываются это название, но тем не менее, этнической принадлежности своих собственных."
 culture_neokosmi_desc:0 "Так как Улисс, греки пытались обосноваться в раёнах к западу от Гибралтара и создали там идентичность Неокосми, и до сих пор владеют греко-связаны между собой."
 culture_nepali_desc:0 "Также известен как гуркхов, что непальцы являются одним из многих индийских этнических групп, в основном сосредоточены на исторической Непале."
 culture_nguni_desc:0 "Группа банту этнических групп, то Нгуни является одним из многих коренных африканских племен."
 culture_nieuwereld_desc:0 "Сыны бизнес плаваний голландской Вест-Индской компании, культуры Ниеуверелд скоро Возникший."
 culture_noculture_desc:0 "Литература и традиция здесь отсутствует, в этом некультурных землях, но они до сих пор народы. Что-то подозрительное, не так ли?"
 culture_north_andean_desc:0 "Спустившись с конкистадоров, которые поселились в раёне к северу от Анд, эти люди по-прежнему имеют свои собственные костюмы."
 culture_north_caucasian_desc:0 "В Предкавказских этносах много, но все они разделяют некоторые традиции, в основном в стране Дон-Кубани."
 culture_north_german_desc:0 "Спустившись с тевтонов и пруссаков, немецкий народ унифицированы На протяжении мощной национальной идентичности."
 culture_north_italian_desc:0 "Итальянские люди, которые живут к северу от Тибра, который возник из ломбардов в 9-м веке."
 culture_norwegian_desc:0 "Уроженец область, известная как Норвегия, норвежцы, тем не менее один из скандинавских этнических групп."
 culture_notios_desc:0 "Византийские Австралийские люди смешивают традиции из эллинов и создали Их владеют, получая известную как Нотиос."
 culture_nouvellien_desc:0 "Французы, которые обосновались в Новом Свете постепенно создал свою собственную идентичность, дрейфующий от площади Митрополита Старого Света."
 culture_novisvet_desc:0 "Южные славяне, которые поселились в Новом Свете, медленно унифицировать их различия, но создание новых с европейскими югославами."
 culture_novvymir_desc:0 "Также Алыесканс, эти люди проишодят от казаков и русских, которые правили и уладили Новый Мир."
 culture_novysvet_desc:0 "Из богемы, который медленно поселился в Новом Свете Новýсвěт имеют идентичность своих собственных."
 culture_nowyswiat_desc:0 "Сыновья поляков, которые переехали в Новый Свет по разным причинам, они создали собственные и разные традиции."
 culture_nuba_desc:0 "Собирательный термин для многих этнических групп суданской области, это один из многих африканских групп."
 culture_nuer_desc:0 "Уроженец Нилотиц люди, то нуэры являются одним из многих африканских этнических групп."
 culture_occitan_desc:0 "Поскольку расколе романского языка в нефтяной и дьОц, это, Вы, кто являются латтерс создали свою собственную литературу, в основном с провансальских трубадуров."
 culture_ontustik_desc:0 "Потомки казахов и монголов, осевших на Греат Соутхерн Ланд."
 culture_oriya_desc:0 "Одна из многих этнических групп Хиндустани, то ория или она антипатии правили на многих региональных государств."
 culture_oromo_desc:0 "Одна из многих этнических групп, сосредоточенных в раёне Африканского Рога, оромо является родной этнической группой."
 culture_ostrogothic_desc:0 "Инвасорс Италии в 5-м веке, остготы в основном известны Теодориха Берна, их главного правителя."
 culture_ovimbundu_desc:0 "Одна из многочисленных групп банту к югу от бассейна Конго, овимбунду является африканцей этничности."
 culture_panjabi_desc:0 "Также пишется пенджабцев, это один многие коренные хиндустани этнических групп."
 culture_pashtun_desc:0 "Один из двух этнических групп афганского народа, пуштуны имеют свои собственные традиции и костюмы."
 culture_patagonian_desc:0 "Коренные народы Патагонской области, которые предшествовали контакт со старым миром."
 culture_penutian_desc:0 "Еще один из многих коренных этнических семей, в Пенутианс были в основном сосредоточены на побережье Тихого океана."
 culture_persian_desc:0 "Персы или иранцы являются людьми, которые в основном населяют территорию Персии и спускающиеся от древней империи Сасанидов."
 culture_phianam_desc:0 "Сонс Индокитай, осевшие на Греат Соутхерн континента, Пхианам полностью отличаются от их Старого Света братьев и сестер."
 culture_picard_desc:0 "Несколько иная группа между французами и валлоны, то Пицардс, тем не менее владельцы конкретных костюмов."
 culture_pictish_desc:0 "Один из немногих кельтских народов в современном мире, пикты живут в регионе и одноименном боролись против Инглеза своих соседей."
 culture_plains_algonquian_desc:0 "Один из самых густонаселенных Нативе группы Нев Ворлд, алгонкинов есть много различных племен. Это те Великие равнины."
 culture_platinean_desc:0 "Спустившись с конкистадоров, которые поселились в раёне Патагонии, эти люди по-прежнему имеют свои собственные костюмы."
 culture_polar_bears_desc:0 "С момента вторжения Ян Маыенесе Старого Света, белые медведи никогда не перестали делать люди дрожать в страхе."
 culture_polish_desc:0 "Сыновья Леха, поляки в основном правило Вистулан бассейна с 8-го века, и, возможно, даже раньше."
 culture_poludniowy_desc:0 "Сонс поляков, поселившихся Большой Южный континент, с традициями своего."
 culture_polynesian_desc:0 "Родные и доминирующие Жители одного из трех основных регионов Океании. Это полинезийцы."
 culture_portuguese_desc:0 "Этническая группа, самая западная часть Пиренейского полуострова, португальцы проишодят от предков лузитаны и свевы."
 culture_qalindigi_desc:0 "Сыновья тюркского популацес, осевшего на африканский континент, то Яалиндиги являются собственниками конкретных костюмов."
 culture_quechua_desc:0 "Основные коренные жители области вокруг озера Титикака, кечуа правили на многих государств региона."
 culture_rajput_desc:0 "На самом деле в индийских кастах, раджпуты проишодят от господствующих классов, тем не менее, являются этнические Их собственное."
 culture_romanian_desc:0 "Влачс или даки, румыны утверждают, проишождение от древней Римской империи и говорят на языке Романце."
 culture_ruanda_desc:0 "Нишодящее руандийского государства, это один из многих коренных африканских этнических групп."
 culture_rundi_desc:0 "Нишодящее государство Бурунди, это один из многих коренных африканских этнических групп."
 culture_russian_desc:0 "Из Киевской Руси раннего Средневековья, русская идентичность медленно получила единство и стать чрезвычайно мощными."
 culture_saahi_desc:0 "Из степей Шелкового пути, персы обосновались в африканских степей и пустынь, создавая новые идентичности."
 culture_sami_desc:0 "Также известно как саамы, саамы являются одним из коренных оленей охотников этнических групп Скандинавии."
 culture_sara_desc:0 "Группа преобладающими вблизи озера Чад, Сара является одним из коренных африканских этнических групп."
 culture_schwarzreicher_desc:0 "Немецкие поселенцы, интертвиннед с африканскими аборигенами, создали совершенно новые традиции. Это Счварзреичерс."
 culture_scottish_desc:0 "Народ верен себе, шотландцы никогда не забудет бороться Инглесе их соседей, по традиции."
 culture_sena_desc:0 "Этническая группа в центре, недалеко от озера Малави Сена является собственной культурой и родом из Африки."
 culture_senufo_desc:0 "Также известно как баман, это один из многих западно-африканских этнических групп."
 culture_sephardic_desc:0 "Сонс евреев выгнали из испанского полуострова, сефардская все еще выступают за Израиль своей родиной."
 culture_serb_desc:0 "Сыновья православных славян на Балканах, сербы не забудут свою национальную идентичность и традиции."
 culture_shan_desc:0 "Одна из этнических групп Индокитая, люди Шан не менее важны, чем другие."
 culture_shona_desc:0 "Группа банту этнических групп, то Шона является африканской родной группой в основном сосредоточен в области Родезийской."
 culture_siberian_desc:0 "Обитая в замороженной и бесплодной земле, сибиряки являются в основном кочевой национальностью."
 culture_sidama_desc:0 "Один из Африканского Рога этнических групп, то Сидама сохранить свое культурное наследие."
 culture_sindi_desc:0 "В синдхи люди один из многих западных хиндустани популацес."
 culture_sinhala_desc:0 "В Сингалах те, обитающие в основном цейлонское остров."
 culture_siouan_desc:0 "Дакота, лакота, Накота назад, все они имеют общее проишождение и сиу язык."
 culture_slovak_desc:0 "Нация похожа на соседних чех, словаки имеют свою собственную идентичность и претендовать на государственную нацию."
 culture_slovene_desc:0 "Славяне Иллирии, словенцы проишодят от столкновения хорватов и австрийских немцев."
 culture_smugly_desc:0 "Также Сагаллоанс, что самодовольно люди спускаются с русских и казачьих поселенцев Африки."
 culture_somali_desc:0 "Одна из основных этнических групп в раёне Африканского Рога, сомалийцы, в основном, известны своим беспощадным пиратство."
 culture_songhai_desc:0 "Группа Западной Африки, этнические Сонгай являются мощной и когда-то правила могущественную империю."
 culture_sonoran_desc:0 "Пуебло, Шошоне, Каёва назад, коренные племена Сонора являются одним из оригинальных Нового Света культур."
 culture_sotho_desc:0 "Группа банту в южной части Африки, сото еще претендовать на царство своего."
 culture_south_andean_desc:0 "Спустившись с конкистадоров, которые поселились в раёне южной части Анд, эти люди по-прежнему имеют свои собственные костюмы."
 culture_south_german_desc:0 "Спустившись с германцев и австрийцев, немецкий народ унифицированы На протяжении мощной национальной идентичности."
 culture_south_italian_desc:0 "Итальянские люди, которые живут к югу от Тибра, они в основном Оптед феодализма и латифондисм."
 culture_spanish_desc:0 "Как кастильянцы, испанцы править в Европе, спускаясь от вестготов и иберо-римлян."
 culture_sudanese_desc:0 "Люди, которые живут в раёне, известном как Судан, произрастающий на африканский континент."
 culture_sudic_desc:0 "Сыновья валахов, которые пошли исследовать Большой Южный континент, то Судиц отрицает другую идентичность от Римской империи."
 culture_sudreicher_desc:0 "Немцы, которые основали свою идентичность в южных странах, отсюда и название, буквально означает «те из Южного Рике \»."
 culture_suebi_desc:0 "Большая группа племен мигрировали из Германиан Это бассейн и поселился в Галиции, швабы все еще боятся."
 culture_sukuma_desc:0 "Одна из групп банту, сосредоточенных вокруг Великих озер, то сукум являются уроженцами Африканского континента."
 culture_sureno_desc:0 "Сыновья латиноамериканцев, которые пошли исследовать Греат Соутхерн континента, Сурено имеют собственные традиции и различные народные диалекте."
 culture_svart_desc:0 "Поселенцы викингов Африки, которые создали свою собственную идентичность, не забывая при этом своих предков с более холодным климатом."
 culture_swahili_desc:0 "Этническая группа в Восточной Африке, может быть, один из самых втекающих, суахили имеет сильную национальную идентичность."
 culture_swedish_desc:0 "Группа родом из Швеции, шведское проишождение от викингов и те, кто создал эту игру."
 culture_swiss_desc:0 "Конфедерация, которые восстали против немцев, швейцарцы имеют национальную идентичность, не хватает общего языка."
 culture_sydlig_desc:0 "Скандинавские поселенцы Великого Южного континента, они создали собственную идентичность и собственные традиции."
 culture_tajik_desc:0 "Хотя персидские говоря, таджики являются кочевыми людьми, которые отличаются от персов."
 culture_tamil_desc:0 "Тамилы являются один из многих, многих групп коренных на субконтиненте Хиндустани."
 culture_tarascan_desc:0 "Ишодя из средневекового Нового Света были, тараски имеют национальную идентичность своих собственных."
 culture_tatar_desc:0 "Татары, многое другие группы населения, стебли, из которых, являются ли этими тюркскими российскими жителями в большей области."
 culture_teda_desc:0 "Также известно как туба, люди Теда произрастает в раён к северу от озера Чад."
 culture_telegu_desc:0 "Дравидиан этнический, то телега, опять же, еще один из многих индийских этнических групп."
 culture_texan_desc:0 "Техасцы не являются американцами, техасцы не мексиканцы, они имеют свои собственные традиции, и этого достаточно."
 culture_thai_desc:0 "Тайские или сиамские люди Индокитая со своими собственными традициями."
 culture_thegioimoi_desc:0 "Индокитайские люди, поселившиеся в Новый Свет, люди Тхегиоимои отличаются от Старого Света братьев и сестер."
 culture_tibetan_desc:0 "Уроженец группа Тибетского нагорья, тибетцы считают себя, в отличие от их китайских соседей."
 culture_tigray_desc:0 "В Тиграянс является одна из многих групп Африканского Рога."
 culture_tiv_desc:0 "Этно-лингвистических групп Африки, культура Тив имеет свои традиции."
 culture_tonga_desc:0 "Народ Тонга в основном живет в Малави, где они находятся в родных культурах."
 culture_tswana_desc:0 "Люди тсваны являются уроженец группой Южной Африки, спускаясь от банту предков."
 culture_tuareg_desc:0 "Подобно берберских своих братьев и сестер, народ туарегов населяет номадицаллы Сахели."
 culture_tupi_desc:0 "Народ тупи являются одним из наиболее важных бразильских коренных этнических групп коренного населения."
 culture_turkish_desc:0 "Турки один из тюркских групп, но только один с арабской вязью, и известны Османской империи и их кухни."
 culture_turkmen_desc:0 "Туркмены являются одной из этнических групп Центральной Азии, с собственными традициями и костюмами."
 culture_ugrian_desc:0 "Ханты и манси разделяют многие традиции и подобный язык, следовательно, общий-угорская культура."
 culture_uighur_desc:0 "Уйгуры являются тюркской группы, проживающие в китайской провинции Синьцзян и известен также как люди."
 culture_ujvilag_desc:0 "Сыновья мадьяр Нового Света, люди Úйвилáг имеют традиции своих."
 culture_ukrainian_desc:0 "Украинцы шодят с казаками и имеют свою собственную идентичность, отличную от российских соседей."
 culture_undead_desc:0 "Люди, которые вернулись из смерти, в основном Вампиры, зомби, оборотней или, правила и налетов в этом грешном мире."
 culture_unyamwezi_desc:0 "Сосредоточенная в одноименной исторической танзанийским области, Унямвези являются африканцем группой."
 culture_usmailmian_desc:0 "Сонс эстонцев и латышей, которые обосновались в Новом Свете, в Усмаилмиан люди в разных традициях."
 culture_uzbek_desc:0 "Тюркский этнос Центральной Азии, узбекско главным образом соотноситься с историческим состоянием Буккхара."
 culture_vietnamese_desc:0 "Вьетнамский народ, произрастающий в Индокитай, есть много традиций и может быть коварны в войне."
 culture_vinlander_desc:0 "Хотя это и не сыновья оригинальной колонии Винланд, люди Винландер спускаются с викингами, которые обосновались в Новом Свете."
 culture_visigothic_desc:0 "Западные Готы один из народов, напавших на Римскую империю, оседания и расширения На протяжении всей истории."
 culture_wallonian_desc:0 "Подобно их французским братьям и сестрам, валлоны являются одной из этнических групп в раёне, известном как «Бельгия \»."
 culture_welsh_desc:0 "Один из немногих кельтских народов в современном мире, валлийцы живут в регионе и одноименном боролись против Инглеза Их соседи."
 culture_western_slavic_desc:0 "Люди, населяющие регион Красной Малороссии, в Червенианс также известны как «славяне Западной \»."
 culture_wolof_desc:0 "Этническая группа в основном в Сенегамбиа области, люди Волоф являются родными для Африки."
 culture_xhosa_desc:0 "Люди Ххоса являются одним из коренных африканских племен южной части континента."
 culture_yakut_desc:0 "Саха или якуты один из людей, которые населяют земли к востоку от Урала."
 culture_yankee_desc:0 "Янкеес или Объединенные Статесианс являются Инглесе говоря Новый мир, что люди восстали против британского ига."
 culture_yao_desc:0 "Еще одна из китайских этнических групп, люди Яо в ​​основном сосредоточены вокруг Хунань области."
 culture_yenidun_desc:0 "В Ыенидюн люди проишодят от турецкого народа, обосновавшихся в Новом Свете."
 culture_yi_desc:0 "Еще одна из китайских этнических групп, люди Ыи в основном сосредоточены вокруг Юньнань региона."
 culture_yoruba_desc:0 "Ёруба проишодит от коренных африканцев в основном в раёне Гвинейского залива."
 culture_yue_desc:0 "Еще одна из китайских этнических групп, люди Ыи в основном сосредоточены вокруг провинции Сычуань."
 culture_yuzhny_desc:0 "Люди Южны проишодят от русских и казачьих поселенцев Великого Южного континента."
 culture_zapotec_desc:0 "С 8-го века до н.э., сапотеки имели свою сильную национальную идентичность, выживание до сегодняшнего дня."
 culture_zhuang_desc:0 "Еще одна из китайских этнических групп, люди Чжуан в основном сосредоточены вокруг Гуанси-Чжуанский области."
 culture_zuidelijk_desc:0 "Люди Зуиделийк в основном переселенцы из голландских колоний в так называемой Земле Вана Диеменсь."
 culture_zulu_desc:0 "Народ зулу наиболее воин и труднообрабатываемая властвуйте родную этносы Африки."
 culture_gypsy:0 "Цыганский"
 culture_gypsy_desc:0 "Цыгане - это странствующая группа, спускающаяся с индийской неприкасаемой касты."
 culture_brithenig:0 "Брифенигский"
 culture_brithenig_desc:0 "Брифенигский проистекает из Латинского наследия Римской империи, как романский британский язык."
 culture_gaul:0 "Галльский"
 culture_gaul_desc:0 "Голливудские люди - одна из немногих кельтских ныне этнических групп, и они все еще правят в Галлии."
 culture_laessin:0 "Лэссинский"
 culture_laessin_desc:0 "Люди Лэссина являются результатом латинского наследия вне германских лаймов."
 culture_volga_german:0 "Волга Немецкий"
 culture_siebenburger:0 "Трансильванский саксон"
 culture_swiss_french:0 "Швейцарский (французский)"
 culture_swiss_german:0 "Швейцарский (немецкий)"
 culture_swiss_italian:0 "Швейцарский (итальянский)"
 culture_romansh:0 "Швейцарский (ретороманский)"
