 culture_volga_german_desc:0 "Этнические немцы, которые колонизировали район Волги, в течение веков они в основном жили как меньшинство."
 culture_siebenburger_desc:0 "Предоставляя Трансильвании свое второе имя, Зибэнбюргэри являются потомками саксов, которые поселились в бассейне Дакии."
 culture_swiss_french_desc:0 "Конфедерация, восставшая против немцев, швейцарцы имеют национальную идентичность, не имея общего языка."
 culture_swiss_german_desc:0 "Конфедерация, восставшая против немцев, швейцарцы имеют национальную идентичность, не имея общего языка."
 culture_swiss_italian_desc:0 "Конфедерация, восставшая против немцев, швейцарцы имеют национальную идентичность, не имея общего языка."
 culture_romansh_desc:0 "Конфедерация, восставшая против немцев, швейцарцы имеют национальную идентичность, не имея общего языка."
 culture_rhinelander_desc:0 "После завоевания Наполеона в Рейнской области, французы и немцы скрещивались, рождая новую культуру Ренаниена."
 culture_arpitan_desc:0 "Спустившись из Королевства Арль, люди Арпитана являются этнической принадлежностью, хотя они веками жили под французским игом."
 culture_montenegrin_desc:0 "Сыновья православных славян и элитный класс Королевства Диоклея, черногорцы похожи на сербов, но имеют другую национальную идентичность."
 culture_dagestani_desc:0 "Предкавказских этнических групп много, но все они имеют некоторые традиции, в основном в стране Дон-Кубани."
 culture_chechen_desc:0 "Предкавказских этнических групп много, но все они имеют некоторые традиции, в основном в стране Дон-Кубани."
 culture_circassian_desc:0 "Предкавказских этнических групп много, но все они имеют некоторые традиции, в основном в стране Дон-Кубани."
 culture_anglo_indian_desc:0 "Элитный британский класс колонизаторов, захвативший Индию, медленно принял местные костюмы и создал свои собственные традиции."
 culture_alaskan_desc:0 "Сыновья англоязычных пионеров, которые отправились на бесплодную пустыню Аляски, аляскинцы - сильная культура."
 culture_neo_zelandais_desc:0 "Несмотря на то, что жители Южных земель спускаются с французов и оккупантов, по-прежнему имеют свои традиции и костюмы."
 culture_louisianan_desc:0 "Французские люди, которые поселились в Новом Свете, медленно создали свою собственную идентичность, дрейфуя из Столичного района Старого Света."
 culture_cajun_desc:0 "Французские люди, которые поселились в Новом Свете, медленно создали свою собственную идентичность, дрейфуя из Столичного района Старого Света."
 culture_french_australian_desc:0 "Несмотря на то, что жители Южных земель спускаются с французов и оккупантов, по-прежнему имеют свои традиции и костюмы."
 culture_kreol_desc:0 "Сыновья карибских рабов более темной кожи, которые восстали против своих белых повелителей, создали традиции и культуры реального значения."
 culture_griqua_desc:0 "Одна из многих коренных африканских национальностей, люди Гриквы едва ли имели шанс на значимость на протяжении многих веков, вплоть до современной эры."
 culture_western_nigritic_desc:0 "Один из многих коренных африканских народов, западные нигрейцы, едва ли мог найти значимость на протяжении многих веков, вплоть до современной эры."
